import Get from "./components/GetAxios";
import GetMath from "./components/RandomMath";
import PostCard from "./components/PostCard";

function App() {
  return (
    <div className="container">
      <div
        className="card col-lg-3 bg-light shadow p-2"
        style={{ marginTop: "20px" }}
      >
        <h1>Vannara Thong Portfolio</h1>
      </div>
      <hr />
      {false && <Get />} {false && <GetMath />}
      <PostCard />
    </div>
  );
}

export default App;
